var _ = FDescribe("helm :: hooks :: deprecated_versions ::", func() {
	f := HookExecutionConfigInit(`{"global" : {"discovery": {"kubernetesVersion": "1.22.3"}}}`, "")

	Context("test", func() {
		BeforeEach(func() {
			f.KubeStateSet(pma)
			f.BindingContexts.Set(f.GenerateScheduleContext("*/1 * * * *"))
			f.RunGoHook()

		})
		It("ok", func() {
			fmt.Println("OK")
			fmt.Println(f.MetricsCollector.CollectedMetrics())
			Expect(f).To(ExecuteSuccessfully())
		})
	})
})

